export const altaMedicoRequest = (data , setMedicoData) => {

    const options = {

    method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json'
        },
        body: JSON.stringify(data)}
    fetch('https://localhost:8080/users/altaMedico', options)
        .then(res =>{ 
            console.log(res)
            setMedicoData(res)
            res.json()})
        .then(res => {

            console.log(res)});


}
